import { Box } from "@chakra-ui/core";
import { AngleSection } from "./AngleSection";
import { Logo } from "./Logo";

export const Hero = props => {
  return (
    <AngleSection height="90vh" color="original.primary" {...props}>
      Text
    </AngleSection>
  );
};
